package com.leetcode.hashtable_problem.p0242;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

public class ValidAnagram {
    public static void main(String[] args) {
        //String t = "";
        //String s = "";
        System.out.println(new ValidAnagram().isAnagram("s", "t"));
    }

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        if (s.length() == 0) return true;
        Map<Character, Integer> map_s = new HashMap<>();
        Map<Character, Integer> map_t = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if (!map_s.containsKey(s.charAt(i))) map_s.put(s.charAt(i), 1);
            else map_s.put(s.charAt(i), map_s.get(s.charAt(i)) + 1);
            if (!map_t.containsKey(t.charAt(i))) map_t.put(t.charAt(i), 1);
            else map_t.put(t.charAt(i), map_t.get(t.charAt(i)) + 1);
        }
        if (map_s.size() != map_t.size()) return false;
        for (Character c : map_s.keySet())
            if (!map_s.get(c).equals(map_t.getOrDefault(c, 0))) return false;
        return true;
    }
}
